function setDuration(e){durationInSeconds=e}function setRedirectionURL(e){redirectionURL=e}function updateProgressBar(){function e(){o>=n?window.location.replace(redirectionURL):(o+=r,t.value=o,requestAnimationFrame(e))}const t=document.getElementById("progressBar"),n=parseInt(t.getAttribute("max"),10),r=n/(1e3*durationInSeconds/60);let o=0;e()}function startProgress(e,t){setDuration(e),setRedirectionURL(t),updateProgressBar()}let durationInSeconds,redirectionURL;